import React from 'react';
// import React, { Component } from "react";
import './Style.css';

const progressBar = ({done}) => {
    const [style, setStyle] = React.useState({});

    setTimeout(() => {
        const newStyle = {
            opacity: 1,
            width: `${done}%`
        }

        setStyle(newStyle);
    }, 200);

    return (
        <div className = "progress">
            <div className = "progress-done" style = {style}>
                {done}%
            </div>
        </div>
    )
}
